import React, { Fragment } from "react";
import ReactDOM from "react-dom";
import * as modelStyle from "./Model.module.css";

const Model = (props) => {
  return ReactDOM.createPortal(
    <Fragment>
      <div class={modelStyle.card}>
        <div class={modelStyle["card-header"]}>Header Text</div>
        <div class={modelStyle["card-content"]}>
          <p>
            Middle content goes here. This can be a long message or paragraph.
          </p>
        </div>
        <div class={modelStyle["card-footer"]}>Secret Code: XYZ123</div>
      </div>
    </Fragment>,
    document.getElementById("model")
  );
};

export default Model;
